import React from 'react'
import './ProjectSections.css'
import CardItem from './CardItem';
import Cards from './Cards';

function ProjectSections(props) {
    return (
        <div>
            <h1>{props.title}</h1>
            <p>{props.paragraph}</p>
        </div>
    )
}

export default ProjectSections
